INSERT INTO `charts` (`CHART_ID`, `TYPE`, `RELATED_CHARTS`, `INDICATOR_ID`, `CHART_SHORT_TITLE`, `CHART_LONG_TITLE`, `CARROUSEL_TITLE`, `VISUALISED`, `RELATED_MESSAGE`, `RELATED_MESSAGE_EURO`, `X_AXIS`, `Y_AXIS`, `X_AXIS_EURO`, `Y_AXIS_EURO`) VALUES
	(1, 'SIMPLE', NULL, 1, NULL, NULL, NULL, b'1', NULL, NULL, NULL, 'billion $', NULL, 'billion €'),
	(2, 'SIMPLE', NULL, 2, NULL, NULL, NULL, b'1', NULL, NULL, NULL, 'billion $', NULL, 'billion €'),
	(3, 'COMPOSED', '1, 2', NULL, 'Cost to society of work-related injury and illness', 'Cost to society of work-related injury and illness', NULL, b'1', 'Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately 2,248 billion and 504 billion, respectively.\r\n billion and 504 billion, respectively.', 'Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately Work-related injuries and illnesses result in the loss of 3.7% of all work-years globally and 3.2% of those in the EU, equivalent to a cost of  approximately 2,206 billion and 454 billion, respectively.', NULL, NULL, NULL, NULL),
	(4, 'SIMPLE', NULL, 3, NULL, NULL, NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(5, 'SIMPLE', NULL, 4, NULL, NULL, NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(6, 'COMPOSED', '4,5', NULL, 'Mortality: deaths resulting from work-related injury and illness (number of fatalities)', 'Mortality: deaths resulting from work-related injury and illness (number of fatalities)', NULL, b'1', 'Work-related illnesses account for 86% of all deaths related to work globally and 98% in the EU.', NULL, NULL, NULL, NULL, NULL),
	(7, 'SIMPLE', NULL, 5, NULL, NULL, NULL, b'1', NULL, NULL, 'Millions of years', NULL, NULL, NULL),
	(8, 'SIMPLE', NULL, 6, NULL, NULL, NULL, b'1', NULL, NULL, 'Millions of years', NULL, NULL, NULL),
	(9, 'COMPOSED', '7,8', NULL, 'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)', 'DALY (disability-adjusted life years) lost due to work-related injury and illness (millions of years)', NULL, b'1', 'In total, 134.2 million DALY are lost globally as a result of work-related injury and illness and 7 million in the EU. 56.2 million of these are years of life lost due to fatal injury or illness (3.4 million in the EU) and 48.2 million are lived with disability (3.6 million in the EU)', NULL, NULL, NULL, NULL, NULL),
	(10, 'SIMPLE', NULL, 7, 'Percentage of all work-related deaths due to different illnesses or injury', 'Percentage of all work-related deaths due to different illnesses or injury', NULL, b'0', NULL, NULL, NULL, NULL, NULL, NULL),
	(11, 'SIMPLE', NULL, 8, 'Percentage of all work-related deaths due to different illnesses or injury', 'Percentage of all work-related deaths due to different illnesses or injury', NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(12, 'COMPOSED', '10,11', NULL, 'What are the main work-related illnesses and injuries resulting in death?', 'What are the main work-related illnesses and injuries resulting in death?', NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(13, 'SIMPLE', NULL, 9, 'Percentage of all work-related DALY due to different illnesses or injury', 'Percentage of all work-related DALY due to different illnesses or injury', NULL, b'0', NULL, NULL, NULL, NULL, NULL, NULL),
	(14, 'SIMPLE', NULL, 10, 'Percentage of all work-related DALY due to different illnesses or injury', 'Percentage of all work-related DALY due to different illnesses or injury', NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(15, 'COMPOSED', '13,14', NULL, 'What are the main work-related illnesses and injuries resulting in DALY?', 'What are the main work-related illnesses and injuries resulting in DALY?', NULL, b'1', 'Cancer is the biggest killer with 106,307 fatal cases per year in EU28, followed by Circulatory illnesses with 49,462 cases. Also, Cancer has the highest DALY (Years of Life Lost or Years Lived with Disability).', NULL, NULL, NULL, NULL, NULL),
	(16, 'SIMPLE', NULL, 11, 'Mortality: deaths per 100,000 workers', 'Mortality: deaths per 100,000 workers', 'Mortality', b'1', 'The mortality rate (deaths resulting from work-related injury and illness per 100,000 workers) ranges from 56 cases in AMRO to 109 cases in EURO per 100,000 workers (93 in the EU28). 80%-98% are due to work-related illness.', NULL, 'Fatal cases', NULL, NULL, NULL),
	(17, 'SIMPLE', NULL, 12, 'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers ', 'Years of Life Lost (YLL) resulting from fatal cases per 100.000 workers ', 'Years of life lost', b'1', 'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from 1,266 years in AMRO to 2,775 years in SEARO per 100.000 workers (1,561 in the EU28).', NULL, 'YLL', NULL, NULL, NULL),
	(18, 'SIMPLE', NULL, 13, 'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD) ', 'Total years lost: Comparison of Years of Life Lost (YLL) and Years Lived with Disability (YLD) ', 'Years of Life Lost vs Years Lived with Disability', b'1', 'In all regions except WPRO, more years are lived with disability (YLD) than are lost due to early death (YLL). In the EU28, YLD accounts for 51% and YLL for 49%.', NULL, NULL, NULL, NULL, NULL),
	(19, 'SIMPLE', NULL, 14, NULL, NULL, NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(20, 'SIMPLE', NULL, 15, NULL, NULL, NULL, b'1', NULL, NULL, NULL, NULL, NULL, NULL),
	(21, 'COMPOSED', '19,20', NULL, 'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of contribution to work-years lost expressed as percentage equivalent of total GDP (%)', 'Cost to society in terms of DALY rate (years per 100,000 workers) and in terms of contribution to work-years lost expressed as percentage equivalent of total GDP (%)', 'Total cost', b'1', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 3,190 years in WPRO to 4,397 years in SEARO (3,200 in the EU28). \r\nThe total cost can be expressed as DALY rate or contribution to work-years lost expressed as percentage equivalent of total GDP  (%). In this sense, the workyears loss ranges from 3.19% in WPRO to 4.40% in SEARO.', NULL, NULL, NULL, NULL, NULL),
	(22, 'SIMPLE', NULL, 16, 'Years of Life Lost (YLL) per 100,000 workers', 'Years of Life Lost (YLL) per 100,000 workers', 'Years of life lost', b'1', 'The rate of years of Life Lost (YLL per 100,000 workers) due to work-related injury and illness ranges from from 940 years in Malta to 2,616 years in Bulgaria per 100.000 workers (1,561 in the EU28).', NULL, NULL, 'YLL per 100,000 workers', NULL, NULL),
	(23, 'SIMPLE', NULL, 17, 'Years lived with disability (YLD) per 100,000 workers', 'Years lived with disability (YLD) per 100,000 workers', 'Years lived with disability', b'1', 'The rate of years of Lived with Disability (YLD per 100,000 workers) due to work-related injury and illness ranges from 795 years in Estonia to 6,401 years in Portugal per 100.000 workers (1,639 in the EU28).', NULL, NULL, 'YLD per 100,000 workers', NULL, NULL),
	(24, 'SIMPLE', NULL, 18, 'Total years lost: Disability adjusted life years (DALY) per 100,000 workers', 'Total years lost: Disability adjusted life years (DALY) per 100,000 workers', 'Total years lost', b'1', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 2,191 years in Malta to 7,894 years in Portugal (3,200 in the EU28).', NULL, NULL, 'DALY per 100,000 workers', NULL, NULL),
	(25, 'SIMPLE', NULL, 19, 'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'Cost expressed as proportion of all work-years lost expressed as percentage equivalent of total GDP (%)', 'Total GDP workyears lost', b'1', 'The total cost can be expressed as DALY rate or as contribution to work-years lost expressed as percentage equivalent of total GDP (%). In this sense, the workyears loss ranges from 2.19% in Malta to 7.89% in Portugal (3.20% in the EU28).', NULL, NULL, 'GDP lost (%)', NULL, NULL),
	(26, 'SIMPLE', NULL, 20, 'Work-related injury contribution to total GDP work-years lost', 'Work-related injury contribution to total GDP work-years lost', 'From work-related illnesses', b'1', 'Work-related injuries contribution to the work-years lost ranges from 0.04% in Netherlands to 0.77% in Portugal (0.14% in the EU28).', NULL, NULL, 'GDP lost (%)', NULL, NULL),
	(27, 'SIMPLE', NULL, 21, 'Work-related illness contribution to total GDP work-years lost (%)', 'Work-related illness contribution to total GDP work-years lost (%)', 'From work-related injuries', b'1', 'Work-related illnesses contribution to workyears lost ranges from 1.95% in Malta to 7.13% in Portugal (3.06% in the EU28).', NULL, NULL, 'GDP lost (%)', NULL, NULL),
	(28, 'SIMPLE', NULL, 22, 'Mortality distributed by the main work-related illnesses groups and work-related injuries', 'Mortality distributed by the main work-related illnesses groups and work-related injuries', 'Mortality distributed by illnesses', b'0', NULL, NULL, NULL, NULL, NULL, NULL),
	(29, 'SIMPLE', NULL, 23, 'Total years of life lost and lived with disability (DALY) distributed by the main work-related illnessess groups and work-related injuries', 'Total years of life lost and lived with disability (DALY) distributed by the main work-related illnessess groups and work-related injuries', 'Total years lost distributed by illnesses', b'0', NULL, NULL, NULL, NULL, NULL, NULL),
	(30, 'SIMPLE', NULL, 24, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of Life Lost and Years Lived with Disability by illnesses', b'0', NULL, NULL, NULL, NULL, NULL, NULL),
	(31, 'SIMPLE', NULL, 25, 'Main work-related illnesses and DALY (Years of life lost and lived with disability) per 100.000 workers', 'Main work-related illnesses and DALY (Years of life lost and lived with disability) per 100.000 workers', NULL, b'1', 'In the majority of the EU28 and Iceland and Norway, the main part of the cost is due to cancer, followed by musculoskeletal disorders (MSD). More information about the impact of each illness group by country will be analyzed in this section.', NULL, NULL, NULL, NULL, NULL),
	(32, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'All work-related illnesses and injuries', b'1', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) varies from 2,191 years in Malta to 7,894 years in Portugal (3,200 in the EU28).', NULL, NULL, 'DALY per 100,000 workers', NULL, NULL),
	(33, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Cancer', b'1', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from Cancer varies from 642 years in United Kingdom to 1,219 years in Romania (815 in the EU28).', NULL, NULL, 'DALY per 100,000 workers', NULL, NULL),
	(34, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'MSD', b'1', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from MSD varies from 369 years in Malta to 841 years in Portugal (478 in the EU28).', NULL, NULL, 'DALY per 100,000 workers', NULL, NULL),
	(35, 'SIMPLE', NULL, 26, 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Years of life lost and lived with disability (DALY) resulting from the main work-related illnesses groups', 'Circulatory', b'1', 'Disability Adjusted Life Years (DALY) is the sum of Years of Life Lost (YLL) due to work-related death and Years Lived with Disability (YLD) due to work-related injury and illness. DALY rate (years per 100.000 workers) resulting from Circulatory diseases varies from 325 years in Sweden to 689 years in Cyprus (400 in the EU28).', NULL, NULL, 'DALY per 100,000 workers', NULL, NULL),
	(36, 'SIMPLE', NULL, 27, 'Comparison of years of life lost (YLL) by illness group and gender, age group or sector', 'Comparison of years of life lost (YLL) by illness group and gender, age group or sector', NULL, b'0', 'Lorem ipsum Lorem ipsum Lorem ipsum', NULL, NULL, NULL, NULL, NULL);
